import React, { Fragment } from "react";
import { connect } from "react-redux";

const AutoPolicyDashboard = ({ autos }) => {
  const map = new Map();
  map.set("O", "Owned");
  map.set("L", "Lease");
  map.set("F", "Finance");

  return (
    <div className="row">
      <div className="col-6">
        <li className="h5 list-group-item list-group-item-primary">
          List of Automobiles on This Policy
        </li>
        {autos.map((auto) => {
          return (
            <Fragment key={auto.vin}>
              <li className="list-group-item list-group-item-success mt-3">
                Automobile VIN number
              </li>
              <li className="list-group-item">{auto.vin}</li>
              <li className="list-group-item list-group-item-success">Make</li>
              <li className="list-group-item">{`${(
                auto.make + ""
              ).toUpperCase()}`}</li>
              <li className="list-group-item list-group-item-success">Model</li>
              <li className="list-group-item">{auto.model}</li>
              <li className="list-group-item list-group-item-success">Year</li>
              <li className="list-group-item">{auto.year}</li>
              <li className="list-group-item list-group-item-success">
                Financing Status
              </li>
              <li className="list-group-item">{map.get(auto.autoStatus)}</li>
            </Fragment>
          );
        })}

        <div className="list-group-item list-group-item-warning mt-4 text-center">
          View All Registered DriversOn This Vehicle
          <i className="fas fa-arrow-circle-down"></i>
        </div>
      </div>
      <div className="col-6 align-items-end">
        <ul className="list-group">
          <li className="list-group-item list-group-item-warning h5">
            This is a primary list group item
          </li>
        </ul>
      </div>
    </div>
  );
};

const mapStateToProps = (state) => ({
  autos: state.auto,
});

export default connect(mapStateToProps)(AutoPolicyDashboard);
